import React, { Component } from "react";
import { Row, Col } from "reactstrap";
import logo from "assets/logo.png";
import "./App.css";

class App extends Component {
  render() {
    return (
      <>
        <Row className="nav">
          <Col xs="12">
            <Row>
              <Col xs="6" sm="6" md="2">
                <img src={logo} />
              </Col>
              <Col xs="6" sm="6" md="10">
                <span>Agendar mi visita</span>
              </Col>
            </Row>
          </Col>
        </Row>
        <Row>
          <Col xs="12" lg={{ size: 10, offset: 1 }}></Col>
        </Row>
      </>
    );
  }
}

export default App;
